import React, { useEffect, useState } from "react";
import "./App.css";
import Search from "./components/search";
import { getData } from "./utility/data.utilits";

type productData = {
    data: Product[];
};
type Product = {
    id: string;
    name: string;
    year: number;
    color: string;
    pantoneValue: string;
};

const App = () => {
    const [products, setProducts] = useState<Product[]>([]);

    useEffect(() => {
        const fetchData = async () => {
            const data = await getData<productData>(
                "https://reqres.in/api/products"
            );
            return setProducts(data["data"]);
        };

        fetchData();
    }, []);

    return (
        <>
            {products.map((x) => {
                return (
                    <li key={x.id}>
                        <p>Id: {x.id}</p>
                        <p>Name: {x.name}</p>
                        <p>Year: {x.year}</p>
                        <p>color: {x.color}</p>
                        <p>pantoneValue: {x.pantoneValue}</p>

                        <hr />
                    </li>
                );
            })}
        </>
    );
};

export default App;
